La acusación contra OpenAI fue presentada por IYO Inc., una compañía nacida de una incubadora de proyectos de Google que se dedica al desarrollo de audífonos. La presentación se realizó a comienzos de la semana pasada ante un tribunal californiano y la jueza a cargo estableció una orden de restricción que impide a los de Sam Altman usar el nombre io hasta que se resuelva el asunto.

Esto ha obligado a los de Sam Altman a quitar toda referencia a io y la alianza que han conformado con Jony Ive. Recordemos que el antiguo líder de diseño industrial de Apple se va a encargar de diseñar tanto los dispositivos de la compañía, como también las futuras versiones de sus software y aplicaciones.

Así las cosas, el anuncio de la adquisición de io y los respectivos mensajes de Altman y Ive han desaparecido de la web de OpenAI. También se ha eliminado el vídeo en el que ambos empresarios explicaban las motivaciones que impulsaban esta nueva iniciativa. Todavía no se sabe por cuánto tiempo se puede extender esta medida.


"Esta página está temporalmente inactiva debido a una orden judicial tras una demanda de marca registrada de iyO sobre nuestro uso del nombre ''io''. No estamos de acuerdo con la demanda y estamos revisando nuestras opciones", explicaron desde OpenAI.

La alianza entre OpenAI y Jony Ive recibe una demanda por violación de marca registrada
La alianza entre OpenAI y Jony Ive recibe una demanda por violación de marca registrada | io
Desde que se conoció el caso, muchos se preguntan si corre peligro el vínculo entre OpenAI, io, Jony Ive y Sam Altman. La respuesta es bastante directa: No. Según publicó Mark Gurman, de Bloomberg, el acuerdo entre las partes sigue en pie y los trabajos en el primer dispositivo de IA de la firma californiana no se ven afectados.


La eliminación de todas las referencias a io responde, simplemente, al cumplimiento de una orden judicial mientras se trabaja en un resolución al asunto. Pero la compra no se ha disuelto, ni tampoco ha sucedido nada por el estilo.

La adquisición de io por 6.500 millones de dólares fue la ratificación de un vínculo que ya llevaba un par de años siendo noticia. La unión entre Sam Altman y Jony Ive para desarrollar hardware de IA llevaba bastante tiempo despertando un sinfín de rumores y especulaciones.

Todavía no se sabe cuál será el primer producto de OpenAI desarrollado en colaboración con el exjefe de diseño de Apple. Tengamos en cuenta que, además de trabajar junto con Jony Ive, los creadores de ChatGPT se han garantizado los servicios de dos de sus máximos laderos con pasado en Cupertino: Tang Tan, exvicepresidente de diseño de producto del iPhone y el Apple Watch, y Evans Hankey, quien heredó el cargo de Ive tras su salida de la firma californiana.

El primer dispositivo de OpenAI diseñado por Jony Ive se conocerá en 2026. Según reveló el propio Altman, se trata de un gadget que puedes llevar en el bolsillo o dejarlo sobre el escritorio. No obstante, se desconoce de qué se trata. En su momento se especuló con gafas inteligentes, auriculares con cámara y hasta una suerte de collar. Sin embargo, a Ive no le agradarían ese tipo de aparatos y buscaría mantenerse alejado de los dispositivos que sí o sí deben llevarse encima.', NULL, NULL, 'la-alianza-entre-openai-y-jony-ive-encuentra-su-primer-gran-obstaculo-peligra-su-gadget-con-ia', 1);


